import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import "react-responsive-carousel/lib/styles/carousel.min.css";
import './Home.css';

import photo1 from '../assets/p1.jpg';
import photo2 from '../assets/p2.jpg';
import photo3 from '../assets/p3.jpg';

const Home: React.FC = () => {
  return (
    <div className="home-container">
      <section className="home-hero">
        <h1>Welcome to Vietnamese Church</h1>
        <p>
          A place of worship, community, and growth. Join us for services, events, and fellowship!
        </p>
      </section>
      <section className="home-carousel">
        <Carousel
          autoPlay
          infiniteLoop
          showThumbs={false}
          showStatus={false}
          interval={3500}
        >
          <div>
            <img src={photo1} alt="Church Event 1" />
            <p className="legend">Sunday Worship</p>
          </div>
          <div>
            <img src={photo2} alt="Church Event 2" />
            <p className="legend">Community Gathering</p>
          </div>
          <div>
            <img src={photo3} alt="Church Event 3" />
            <p className="legend">Youth Activities</p>
          </div>
        </Carousel>
      </section>
      <section className="home-about">
        <h2>About Us</h2>
        <p>
          Vietnamese Church is dedicated to serving God and our community. We welcome everyone to join our family and experience faith, hope, and love together.
        </p>
      </section>
    </div>
  );
};

export default Home;
